import React from 'react';


function Body(){
    return(
        <>
            <div className='bodycontainer'>
                <div className='bodyfirst'>
                    <h1>War Between Angels & Devils</h1>
                    <iframe width="956px" height="527.24px" src="https://www.youtube.com/embed/tgbNymZ7vqY"></iframe>
                    <div>
                        <h1>The World</h1>
                    </div>
                </div>
            </div>
        </>
    )
}

export default Body;
